const getSize = (size: TSvgSize) => {
  switch (size) {
    case 'xLarge':
      return 48;
    case 'large':
      return 30;
    case 'standard':
      return 24;
    case 'small':
      return 20;
    default:
      return 24;
  }
};

export const makeSvg = (
  svg: ReactElement<LibSvgProps>,
): ((props: TSvgProps) => React.JSX.Element) => {
  return (props: TSvgProps) => {
    const originalProps = svg.props;
    const fillColor = useAppThemeColor(props.fillColor ?? 'transparent');
    const strokeColor = useAppThemeColor(props.strokeColor ?? 'textDark');

    const newProps: LibSvgProps = {
      ...originalProps,
      height: getSize(props.size ?? 'standard'),
      width: getSize(props.size ?? 'standard'),
      fill: fillColor,
      stroke: strokeColor,
      strokeWidth: props.strokeWidth,
    };

    return React.cloneElement(svg, newProps);
  };
};



